timelion 
  ".es(index=kibana_sample_data_ecommerce, metric=sum:taxless_total_price, timefield=order_date)" interval="1d" from={essql "SELECT order_date as min FROM kibana_sample_data_ecommerce order by order_date limit 1" | getCell min} to={essql "SELECT order_date as max FROM kibana_sample_data_ecommerce order by order_date DESC limit 1" | getCell max}
| pointseries x="@timestamp" y="value"
| plot yaxis=false defaultStyle={seriesStyle points="0" bars="50000000" lines="0" color="#62bb96"} font={font size=12 family="Avenir" color="#999" align="left"}

timelion 
  ".es(index=kibana_sample_data_ecommerce, metric=sum:taxless_total_price, timefield=order_date)" interval="1w"
| mapColumn "value" fn={math "round(value,0)"}
| staticColumn "mean" value={math "round(mean(value),0)"}
| mapColumn "mean" "as" "rnd" fn={math "round(random(0.9,1.1),2)"}
| mapColumn "value" "as" "final" fn={math "round(multiply(rnd,mean),2)"}
| pointseries x="@timestamp" y="final"
| plot xaxis=false yaxis=false defaultStyle={seriesStyle points="0" bars="0" lines="3" color="#eb6c66"}
| render containerStyle={containerStyle opacity="0.5"}

